gN2(){return"Lucas "},
gOq(){return"\nJ"},
gOb(){return"Balbach"},
gO9(){return"English"},
gKI(){return"Sobre"},
gKJ(){return"Soy una persona que le gusta ser curiosa: hacer un curso nuevo, aprender un deporte nuevo, tocar un instrumento nuevo. Por alguna raz\xf3n no se detiene ah\xed; necesita ser lo m\xe1s extra\xf1o posible. Si he o\xeddo hablar de algo, o s\xe9 que otra persona lo tiene, dejo de interesarme. Desde las chaquetas moradas que llevo hasta las canciones que escucho, pasando por el software que me gusta hacer; Todo tiene que ser emocionante, \xfanico y hecho de la manera correcta, si no, para qu\xe9 molestarse. Soy un \xe1vido pianista, viajero, practicante de kitesurf, buceador, esquiador alpino de traves\xeda, alpinista y cualquier otra cosa que se me ponga por delante. Hablo espa\xf1ol en su mayor parte - sobre todo para encontrar nueva comida para probar. Me encantan las cosas nuevas, pero me encanta volver a mi rutina, a mi casa, a mis amigos y a mi familia.\n\nNo creo que mi inteligencia o mi talento hayan sido decisivos para llevarme a donde estoy hoy. Para m\xed, es mi curiosidad la que me impulsa a seguir adelante. Aunque pueda tener la capacidad de investigar y escribir un art\xedculo exhaustivo sobre el estalinismo, mi curiosidad me implora hacer algo un poco m\xe1s cautivador. No quiero ofender a nadie que haya dedicado su vida al estalinismo, pero personalmente prefiero rastrillar la hierba cortada en tres montones perfectos. En los \xfaltimos tiempos, ya no escasean los ingenieros de software, sino que cualquiera puede construir un sitio web. Mi necesidad de una respuesta me obliga a ser m\xe1s inventivo y a divertirme m\xe1s. Si me dan tiempo, la curiosidad crear\xe1 algo mucho m\xe1s interesante que la habilidad bruta (no es que carezca por completo de ella). Esta p\xe1gina es el ejemplo perfecto. Aunque s\xed, podr\xeda haber hecho la misma p\xe1gina personal que hace todo el mundo, me parece aburrida y poco interesante. Francamente, creo que ni siquiera podr\xeda terminar una: probablemente acabar\xeda desvaneci\xe9ndome en algo un poco m\xe1s emocionante, como el almuerzo."},
gMO(){return"Experiencia"},
gMT(){return"Ingeniero diplomado de Software | sep 2023 - Presente"},
gMU(){return"\u2022 Desarrollo \xe1gil full stack en Java, Flutter, Python, Svelte, y SQL\n\u2022 Dise\xf1\xf3, desarroll\xf3 e imparti\xf3 importantes secciones de VisaGO - la primera aplicaci\xf3n Visa con emisi\xf3n digital dirigida directamente al consumidor y la primera en lograr m\xe1s de 150.000 descargas en 90 d\xedas\n\u2022 Integraci\xf3n con ChatGPT en m\xfaltiples proyectos internos para agilizar los flujos de trabajo de otros equipos"},
gMP(){return"Becario de Ingenier\xeda de Software | may 2022 - ago 2022"},
gMQ(){return"\u2022 Dise\xf1o y entrega de una interfaz gr\xe1fica de usuario en C++ para ejecutar secuencias de comandos en un simulador de vuelo, incluida la personalizaci\xf3n en XML\n\u2022 Probado emuladores de cabina e integraci\xf3n de software en Learjets, Gulfstreams y el caza X-62"},
gMR(){return"Desarrollador de software junior | jun 2020 - may 2022"},
gMS(){return"\u2022 Trabaj\xf3 en estrecha colaboraci\xf3n con desarrolladores senior para desarrollar m\xf3dulos frontales en la versi\xf3n de producci\xf3n actual\n\u2022 Env\xedo de funciones PHP, HTML y CSS, y prueba de aplicaciones web localmente y a trav\xe9s de TestFlight"},
gOW(){return"Proyectos"},
gOT(){return"La Calculadora de Cometas"},
gOS(){return"La calculadora de cometas es un proyecto que me apasiona. Soy un \xe1vido practicante de kitesurf, windsurf y vela. En lo que se diferencian el kitesurf y el windsurf de la vela es en que, dependiendo del viento, los navegantes pueden subir o bajar la vela, cambiando la cantidad de superficie para que nunca se vean desbordados. Las cometas y los windsurf vienen en un tama\xf1o que no se puede cambiar, por lo que tendr\xe1s que comprar otro de diferente tama\xf1o para navegar con otro tiempo. Dada la naturaleza inesperada del tiempo, para poder hacer kitesurf o windsurf en cualquier lugar con regularidad, necesitar\xe1s al menos dos o tres tallas. En esta incertidumbre es donde entra en juego esta web. Teniendo en cuenta el peso del rider y la velocidad actual del viento, puede darte una talla de cometa recomendada en m2. En el futuro, me gustar\xeda ampliarlo para incluir el windsurf, el kite foiling y el wing foiling, pero por ahora, \xa1disfruta del agua!"},
gOV(){return"Simulador Virtual de Buceo"},
gOU(){return"La realidad virtual permite escapar de la vida cotidiana. Permite a los usuarios experimentar un entorno artificial que de otro modo nunca ver\xedan. La realidad virtual no s\xf3lo se utiliza para el entretenimiento, sino que tiene aplicaciones pr\xe1cticas y educativas muy reales. Este proyecto pretende utilizar la realidad virtual para ense\xf1ar a los usuarios algunos de los fundamentos del submarinismo. Al reducir la barrera de entrada, har\xe1 que el buceo sea m\xe1s accesible y, con un poco de suerte, difundir\xe1 el inter\xe9s por \xe9l. El artefacto final es un simulador de submarinismo que demostrar\xe1 lo aplicable que es la RV como m\xe9todo de ense\xf1anza.\n\nEste simulador de submarinismo utiliza aspectos de cursos de buceo reales para hacerlo m\xe1s realista. Utiliza man\xf3metros virtuales basados en instrumentos de buceo reales y anima a los usuarios a aprender su funcionalidad mediante ensayo y error. Ense\xf1ar una materia a trav\xe9s de la realidad virtual hace que se parezca m\xe1s a un juego. Este cambio de punto de vista puede ayudar a los usuarios a comprometerse con la ense\xf1anza y absorber m\xe1s informaci\xf3n.\n\nLos participantes en el estudio de usuarios del simulador coincidieron en que \xe9ste fomentar\xeda la concienciaci\xf3n medioambiental a pesar de no centrarse demasiado en el tema. Al conseguir que m\xe1s gente se interese por el buceo, el simulador podr\xeda contribuir a difundir la implicaci\xf3n en la conservaci\xf3n de los oc\xe9anos. La mayor\xeda de los participantes pudieron aprender m\xe1s sobre el tema y encontraron la experiencia inmersiva e informativa. El proyecto es una buena base para ampliarlo a otros aspectos del buceo o incluso a otros temas. Tambi\xe9n podr\xeda integrarse en diversos cursos de buceo para ayudar a mejorar y agilizar el proceso de aprendizaje."},
